import React from 'react';
import BubbleContainer from './components/BubbleContainer';
import Layout from './components/Layout';
import styled from 'styled-components';

const AppContainer = styled.div`
  min-height: 100vh;
  background: #0D0D0D;
  color: #fff;
`;

function App() {
  return (
    <AppContainer>
      <Layout>
        <BubbleContainer />
      </Layout>
    </AppContainer>
  );
}

export default App;
